import React from 'react';
import Onboarding from './components/Onboarding';
import Dashboard from './components/Dashboard';
import Marketplace from './components/Marketplace';

function App() {
  return (
    <div>
      <h1>Carbon Credit Platform</h1>
      <Onboarding />
      <Dashboard />
      <Marketplace />
    </div>
  );
}

export default App;
